import React from 'react';
import './Resume.css';
import resume from './resume090420(2).pdf';


export default function Resume () {
    return (
        <div className="resume-page">

            <iframe height="1000" width="100%" src={resume} title="Ross MacDonald Resume">
            </iframe>
        </div>

    )
}
